import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "../styling/hero.css";
import heroImage from "../assets/hero.jpg";

export const Hero = () => {
  return (
    <div className="hero">
      <Container fluid>
        <Row>
          <Col sm={12} md={7} className="hero-text">
            <h1>thenujastore</h1>
            <h2>As unique as you</h2>
          </Col>
          <Col sm={12} md={5}>
            <Col sm={3} md={4}>
              <img src={heroImage} alt="hero" className="img-fluid" />
            </Col>
            <Col sm={3} md={4}>
              <Row sm={6}>
              </Row>
              <Row sm={6}>
              </Row>
              <img src={heroImage} alt="hero" className="img-fluid" />
            </Col>
            <Col sm={3} md={4}>
              <img src={heroImage} alt="hero" className="img-fluid" />
            </Col>
          </Col>
        </Row>
      </Container>
    </div>
  );
};
